int init() { 
    //setvbuf(stdout, NULL, _IONBF, 0);
    long int page_size = sysconf(_SC_PAGE_SIZE);
    long int chals_base;
	FILE* in_file = fopen("/proc/self/maps", "r");
	char string[1024];
    int chals_first = 1;
	while(fgets(string, 1024, in_file) != NULL){
        if(chals_first == 1 && strstr(string, "/chals") != NULL){
            char *str_begin = strtok(string, "-");
            sscanf(str_begin, "%lx", &chals_base);
            //fprintf(stderr, "chals_base: %llx\n", chals_base);

            chals_first = 0;
            break;
        }
    }

	while(fgets(string, 1024, in_file) != NULL){
        //if(strstr(string, "/chals") != NULL){
            fprintf(stderr, "%s", string);
        //}
    }
    fprintf(stderr, "-----------------------------------------------------------------------\n");
    long int GOT_begin = chals_base + GOT_table[0];
    long int GOT_end = chals_base + GOT_table[688];
    //long int int GOT_begin = 0xdb84;
    //long int int GOT_end = 0xdb84 + (0x8 * 1477);
    long int addr = (GOT_begin / page_size) * page_size;
    long int len = (GOT_end / page_size) * page_size + page_size - addr;

    if (mprotect((void *)(addr), len, PROT_READ | PROT_WRITE | PROT_EXEC) == -1)
        fprintf(stderr, "mprotect\n");



	in_file = fopen("/proc/self/maps", "r");
	while(fgets(string, 1024, in_file) != NULL){
        //if(strstr(string, "/chals") != NULL){
            fprintf(stderr, "%s", string);
        //}
    }

    void *handle;
    handle = dlopen("libpoem.so", RTLD_LAZY);
    if (!handle) {
        fprintf(stderr, "%s\n", dlerror());
        exit(EXIT_FAILURE);
    }
    dlerror();  

    //long int GOT_inx = chals_base + 0x17a30;
    for(int i = 0; i < 689; i++){
        int j = 0;
        for(;j < 1477; j++){
            if(ndat[j] == code_[i]){
                break;
            }
        }
        char real_ID[5];
        sprintf(real_ID, "%d", j);
        char dest[10] = "code_";
        strcat(dest, real_ID);

        void* code_func = NULL;
        code_func = dlsym(handle, dest);
        if(i == 0){
            fprintf(stderr, "dest= %s\n", dest);
            fprintf(stderr, "code_func= %p\n", &code_func);
            fprintf(stderr, "code_func= %p\n", code_func);
            fprintf(stderr, "(void*)GOT_table[i] + chals_base= %p\n", (void*)GOT_table[i] + chals_base);
        }

        //memcpy((void*)GOT_inx, &code_func, 0x8);
        memcpy((void*)GOT_table[i] + chals_base, &code_func, 0x8);

        //GOT_inx += 0x8;
    }
    return 0; 
}


